<script type="text/javascript">//<![CDATA[
window.onload=function(){
var arr = [21,2,6,4,7,12,35,89];

function s(arr) {
	var n = arr.length;
  for(var i = 0; i < n-1; i++) {
  	for (var j = 0, j < n-1-i; j++) {
    	if (arr[j + 1] < arr[j]) {
      	var t = arr[j+1];
        arr[j+1] = arr[j];
        arr[j] = t;
      }
    }
  }
  return arr;
}

console.log(s());
}//]]> 

</script>
